drop schema if exists NewInsuranceCo; 
 create schema NewInsuranceCo; 
 use NewInsuranceCo; 
 SET NAMES utf8; 
 SET FOREIGN_KEY_CHECKS = 0; 
 CREATE TABLE `CLIENT` (
	`CLIENT_ID` int(11) NOT NULL,
	`TITLE` varchar(255) NOT NULL,
	`FIRST_NAME` varchar(255) NOT NULL,
	`FAMILY_NAME` varchar(255) NOT NULL,
	`DOB` varchar(255) NOT NULL,
	`PHONE_1` varchar(255) NOT NULL,
	`PHONE_2` varchar(255) NOT NULL,
	`EMAIL` varchar(255) NOT NULL,
	`M_OR_F` varchar(255) NOT NULL,
	`PROFESSION` varchar(255) NOT NULL,
	`ADDRESS_ID` int(11) NOT NULL,
	PRIMARY KEY (`CLIENT_ID`)
	,KEY `ADDRESS_ID` (`ADDRESS_ID`)
	,CONSTRAINT `CLIENT_ADDRESS_ID` FOREIGN KEY (`ADDRESS_ID`) REFERENCES `ADDRESS` (`ADDRESS_ID`)
) ENGINE = InnoDB;
 CREATE TABLE `ADDRESS` (
	`ADDRESS_ID` int(11) NOT NULL,
	`ADDRESS_1` varchar(255) NOT NULL,
	`ADDRESS_2` varchar(255) NOT NULL,
	`ADDRESS_3` varchar(255) NOT NULL,
	`POSTCODE` varchar(255) NOT NULL,
	PRIMARY KEY (`ADDRESS_ID`)
) ENGINE = InnoDB;
 CREATE TABLE `INSURANCE-TYPE` (
	`INSURANCE-TYPE_ID` int(11) NOT NULL,
	`INSURANCE-TYPE` varchar(255) NOT NULL,
	PRIMARY KEY (`INSURANCE-TYPE_ID`)
) ENGINE = InnoDB;
 CREATE TABLE `CONTRACT` (
	`CONTRACT_ID` int(11) NOT NULL,
	`INSURANCE-TYPE_ID` int(11) NOT NULL,
	`POLICY-NO` varchar(255) NOT NULL,
	`CLIENT_ID` int(11) NOT NULL,
	`START-DATE` datetime NOT NULL,
	`END-DATE` datetime NOT NULL,
	`PREMIUM` varchar(255) NOT NULL,
	PRIMARY KEY (`CONTRACT_ID`)
	,KEY `INSURANCE-TYPE_ID` (`INSURANCE-TYPE_ID`)
	,KEY `CLIENT_ID` (`CLIENT_ID`)
	,CONSTRAINT `CONTRACT_INSURANCE-TYPE_ID` FOREIGN KEY (`INSURANCE-TYPE_ID`) REFERENCES `INSURANCE-TYPE` (`INSURANCE-TYPE_ID`)
	,CONSTRAINT `CONTRACT_CLIENT_ID` FOREIGN KEY (`CLIENT_ID`) REFERENCES `CLIENT` (`CLIENT_ID`)
) ENGINE = InnoDB;
 CREATE TABLE `CAR_POLICY` (
	`CAR_POLICY_ID` int(11) NOT NULL,
	`CONTRACT_ID` int(11) NOT NULL,
	`MANUFACTURER` varchar(255) NOT NULL,
	`MODEL` varchar(255) NOT NULL,
	`REGISTRATION` varchar(255) NOT NULL,
	PRIMARY KEY (`CAR_POLICY_ID`)
	,KEY `CONTRACT_ID` (`CONTRACT_ID`)
	,CONSTRAINT `CAR_POLICY_CONTRACT_ID` FOREIGN KEY (`CONTRACT_ID`) REFERENCES `CONTRACT` (`CONTRACT_ID`)
) ENGINE = InnoDB;
